    /**
     * @deprecated Time Limit Exceeded, O(n^3)
     */
    @Deprecated
    public static int lengthOfLongestSubstring(String s) {
        int result = 0;
        String sub = "";

        for (int i = 0; i < s.length(); i++) {       // O(n)
            for (int j = i; j < s.length(); j++) {    // O(n)
                if (sub.indexOf(s.charAt(j)) == -1) {  // O(n)
                    sub = s.substring(i, j+1);
                    if (result < sub.length()) {
                        result = sub.length();
                    }
                } else {
                    sub = "";
                    break;
                }
            }
        }
        return result;
    }

    /**
     * @deprecated Time Limit Exceeded, O(n^2)
     */
    @Deprecated
    public static int lengthOfLongestSubstring1(String s) {
        if (s == null || s.equals("")) return 0;
        int result = 1;
        HashSet<Character> sub = new HashSet<>();

        for (int i = 0; i < s.length(); i++) {       // O(n)
            sub.add(s.charAt(i));
            for (int j = i+1; j < s.length(); j++) {    // O(n)
                if (!sub.contains(s.charAt(j))) {      // O(1)
                    sub.add(s.charAt(j));
                    if (result < sub.size()) {
                        result = sub.size();
                    }
                } else {
                    sub = new HashSet<>();
                    break;
                }
            }
        }
        return result;
    }

    /**
     * @deprecated Time Limit Exceeded, O(n). about 160 ms <br>
     *
     * HashMap memory overhead is too high.
     */
    @Deprecated
    public static int lengthOfLongestSubstring2(String s) {
        if (s == null || s.equals("")) return 0;
        int result = 1;
        HashMap<Character, Integer> sub = new HashMap<>();

        for (int i = 0; i < s.length(); i++) {       // O(n)
            if (!sub.containsKey(s.charAt(i))) {       // O(1)
                sub.put(s.charAt(i), i);
                result = result < sub.size() ? sub.size() : result;
            } else {
                i = sub.get(s.charAt(i)) + 1;
                sub = new HashMap<>();
                sub.put(s.charAt(i), i);
            }
        }
        return result;
    }

    public static int lengthOfLongestSubstring3(String s) {
        if (s == null || s.equals("")) return 0;
        int result = 1;
        HashMap<Character, Integer> sub = new HashMap<>();

        // right control the substring's right edge
        // left control the substring's left edge
        for (int right = 0, left = 0; right < s.length(); right++) {       // O(n)
            // !sub.containsKey(s.charAt(i)) make sure that substring is unique
            // (sub.containsKey(s.charAt(i)) && sub.get(s.charAt(i)) < j) make sure that
            // conflict char behind left. like 'tmmzuxt' last 't' conflict first 't' but out of left
            if (!sub.containsKey(s.charAt(right)) || (sub.containsKey(s.charAt(right)) && sub.get(s.charAt(right)) < left)) {       // O(1)
                sub.put(s.charAt(right), right);
                result = result < (right-left+1) ? (right-left+1) : result;
            } else {
                left = sub.get(s.charAt(right)) + 1;
                sub.put(s.charAt(right), right);
            }
        }
        return result;
    }
